import styles from "./Media.module.scss";
import PosterComponent from "../poster/Poster";
import JumpBar from "../jumpbar/JumpBar";
import ToolBar from "../ToolBar/ToolBar";

const ExplorerComponent = () => {
	const numberOfComponents = 48;
	const posters = [];

	for (let i: number = 1; i < numberOfComponents; i++) {
		posters.push(<PosterComponent id={i} />);
	}
	return (
		<div className={styles.media}>
			<ToolBar />
			<div className={styles.mediaContent}>
				<div className={styles.contentContainer}>
					<div className={styles.content}>{posters}</div>
					<div className={styles.footerContainer}>
						<div className={styles.footer}>
							<div className={styles.keyContainer}>
								<div className={styles.key}>
									<div>Continuing (All episodes downloaded)</div>
									<div>Ended (All episodes downloaded)</div>
									<div>Missing Episodes (Series monitored)</div>
									<div>Missing Episodes (Series not monitored)</div>
								</div>
							</div>
							<div className={styles.dataContainer}>
								<div className={styles.data}></div>
							</div>
						</div>
					</div>
				</div>
				<JumpBar />
			</div>
		</div>
	);
};
export default ExplorerComponent;
